	public Skin(String value, String signature) {
        this(new Property(TEXTURE_KEY, value, signature));
    }

    public Skin(Property property) {
        this.property = property;
    }
	
	@Override
	public String toString() {
		return ('(' + property.getValue() + ';' + property.getSignature() + ')');
	}
	
	@Override
    public boolean equals(Object object) {
        if (object == this) {
            return (true);
    	} else if (object instanceof Skin) {
            Skin other = (Skin) object;
            
            boolean sign = Objects.equals(property.getSignature(), other.getProperty().getSignature());
            boolean value = Objects.equals(property.getValue(), other.getProperty().getValue());
            
            return ((sign) && (value));
        }
        
        return (false);
    }
	
	/**
     * Get a skin from an entity type.
     * 
     * @param type the entity type
     * @return An skin instanced
     */
    public static Skin getMob(EntityType type) {
        return getMob(type, 0);
    }

    /**
     * Get a skin from an entity type and alternate form number.
     * 
     * @param type the entity type
     * @param alternateForm Used if multiple versions of this mob exist (wither skeleton = 1, ender guardian = 1)
     * @return An skin instanced
     */
    public static Skin getMob(EntityType type, int alternateForm) {
        List<Skin> skins = MOB_SKINS.get(type);
        
        if (skins == null || skins.size() == 0) {
        	return (DEFAULT_SKIN);	
        }
            
        if (alternateForm >= skins.size()) {
        	return (DEFAULT_SKIN);
        }
            
        return (skins.get(alternateForm));
    }

    /**
     * Get a cool skin based on a chat color (grey square with a colored dot).
     * 
     * @param color the color
     * @return An skin instanced
     */
    public static Skin getDot(ChatColor color) {
        return (DOT_SKINS.get(color.ordinal()));
    }
    
    /**
     * Get a skin from an online player.
     * @param player the player
     * @return An skin instanced
     */
    public static Skin getPlayer(Player player) {
    	try {
    		EntityPlayer entityPlayer = ((CraftPlayer) player).getHandle();
        	Property property = entityPlayer.getProfile().getProperties().get(Skin.TEXTURE_KEY).iterator().next();
    		
        	return (new Skin(property));
		} catch (Exception e) {
			return (DEFAULT_SKIN);
		}
	}
